import React from "react";
import { Route, BrowserRouter as Router } from "react-router-dom";
import Listeencheres from "./components/Listeencheres";



const App = () => {
  return (
    <Router>
      <Route exact path="/" component={Listeencheres} />
      <Route path="/about" />
      <Route path="*" />
    </Router>
  );
};

export default App;
